import React from "react";
import previous from '../Icon/icons8-previous-48.png';
import pause from '../Icon/icons8-pause-button-50.png';
import play from '../Icon/icons8-circled-play-50.png';
import next from '../Icon/icons8-next-48.png';

const AudioControls = ({
                           isPlaying,
                           onPlayPauseClick,
                           onPrevClick,
                           onNextClick,
                       }) => (
    <div >
        <button
            onClick={onPrevClick}
        >
            <img src={previous} alt="Previous" />
        </button>
        {isPlaying ? (
            <button
                onClick={() => onPlayPauseClick(false)}
            >
                <img src={pause} alt="Pause" />
            </button>
        ) : (
            <button
                onClick={() => onPlayPauseClick(true)}
            >
                <img src={play} alt="Play" />
            </button>
        )}
        <button
            onClick={onNextClick}
        >
            <img src={next} alt="Next" />
        </button>
    </div>
);

export default AudioControls;


